import React, { useEffect, useState } from "react";



function App(){

    const[data,setData]=useState(null)

    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/todos")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
           
            setData(resp)
        })
    })
    return(
        <div>
            <h2>Fetch Data from server</h2>
            <table>
                <thead>
                    <tr>
                    <th>userID</th>
                    <th>id</th>
                    <th>title</th>
                    <th>body</th>
                    </tr>
                </thead>
                <tbody>
                    {
                     data?.map((item)=>(
                        <tr>
                        <td>{item.userId}</td>
                        <td>{item.id}</td>
                        <td>{item.title}</td>
                        <td>{item.body}</td>
                        </tr>
                    ))  }


                </tbody>
            </table>
        </div>
    )
}

export default App;
